import Layout from "../components/layout/layout";

function Checkout() {
  const position = { container: "w-2/4 m-auto" };
  const design = {};
  return (
    <Layout>
      <div className={position.container}>
        <Delivery />
        <Shipping />
        <Payment />
      </div>
    </Layout>
  );
}

export default Checkout;

function Delivery() {
  const position = { container: "w-2/4 m-auto", separator: "h-px my-4" };
  const design = { separator: "bg-gray-200" };

  return (
    <div className={position.container}>
      <hr className={`${position.separator} ${design.separator}`} />
    </div>
  );
}

function Shipping() {
  const position = { container: "w-2/4 m-auto", separator: "h-px my-4" };
  const design = { separator: "bg-gray-200" };

  return (
    <div className={position.container}>
      <hr className={`${position.separator} ${design.separator}`} />
    </div>
  );
}

function Payment() {
  const position = { container: "w-2/4 m-auto", separator: "h-px my-4" };
  const design = { separator: "bg-gray-200" };

  return (
    <div className={position.container}>
      <hr className={`${position.separator} ${design.separator}`} />
    </div>
  );
}
